import React from "react";
import "./ExpenseItem.css";

const ExpenseDate = ({ exp }) => {
  const month = exp.date.toLocaleString("en-US", { month: "long" });
  const day = exp.date.toLocaleString("en-US", { day: "2-digit" });
  const year = exp.date.getFullYear();
  return (
    <>
      <div>{month}</div>
      <div>{day}</div>
      <div>{year}</div>
    </>
  );
};

export default ExpenseDate;
